import React from "react";
import { View, Text, StyleSheet } from "react-native";

export default function SkillBox(props) {
	return (
		<View style={styles.savingBox}>
			<Text style={styles.titleText}>Cheese</Text>
			<View style={styles.numBox}>
				<Text style={styles.numText}>21</Text>
			</View>
		</View>
	);
}

const styles = StyleSheet.create({
	savingBox: {
		flexDirection: "row",
		width: "90%",
		height: 60,
		borderColor: "white",
		borderWidth: 2,
		borderRadius: 5,
		backgroundColor: "#29293d",
		// justifyContent: "space-between",
		alignItems: "center",
		paddingLeft: 10,
		paddingRight: 10,
		marginTop: 15,
	},
	numBox: {
		flex: 1,
		borderColor: "white",
		borderWidth: 1.25,
		borderRadius: 5,
		height: 35,
		width: 35,
		justifyContent: "center",
		alignItems: "center",
		padding: 5,
		backgroundColor: "#353535",
	},
	titleText: {
		flex: 3,
		color: "white",
		fontSize: 20,
	},
	numText: {
		color: "white",
		fontSize: 16,
	},
});
